import React from 'react';

const AnalysisReport = () => {
  return (
    <div style={{display: "flex", justifyContent: "center"}}>
      <iframe
        title="Local HTML File"
        src="./analysis_report.html"
        width="600"
        height="400"
      />
    </div>
  );
};

export default AnalysisReport;
